"use strict";

var express = require('express');

var router = express.Router();

var low = require('lowdb');

var FileSync = require('lowdb/adapters/FileSync');

var adapter = new FileSync('db.json');
var db = low(adapter);
/* GET notes. */

router.get('/', function (req, res) {
  var notes = db.get('notes').value();

  if (notes) {
    return res.status(200).send(notes);
  }

  throw new Error("Server Error");
});
/* GET Individual note. */

router.get('/:noteId', function (req, res) {
  var note = db.get('notes').find({
    id: req.params.noteId
  }).value();

  if (note) {
    return res.status(200).send(note);
  }

  throw new Error("Server Error");
});
/* PUT Individual note. */

router.put('/:noteId', function (req, res) {
  var note = req.body;
  note.editMode = false;
  var updatedNote = db.get('notes').find({
    id: req.params.noteId
  }).assign(note).write();

  if (updatedNote) {
    res.status(200).send(updatedNote);
  }

  throw new Error("Server Error");
});
/* POST Individual note. */

router.post('/:noteId', function (req, res) {
  console.log('create req', req.body);
  var note = req.body;
  var notes = db.get('notes').push(note).write();

  if (notes) {
    res.status(200).send(notes);
  }

  throw new Error("Server Error");
});
module.exports = router;
